import React, { useState, useEffect, Fragment } from 'react';
import '../css/homepage.css';
import book from '../imgs/book.png'

function Homepage() {
    return (
        <Fragment>
            <div className="homepageDiv">
                <div className="form">
                    <image src={book} className="book"></image>
                </div>
            </div>
        </Fragment>
    );
}

export default Homepage;
